import React from 'react';
import Grid from '@material-ui/core/Grid';

const Introduction = () => {
	return (
		<div>
			<Grid item container direction='row-reverse' alignItems='center' justify='center'>
				<Grid item xs={6} alignItems='center' justify='center' class='intro'>
					<h2>کارفرما</h2>
					<h3>پروژه تابپت رو ثبت کن</h3>
					<h3>از بین پیشنهاد ها، تایپیست مورد نظر رو انتخاب کن</h3>
					<h3>هزینه‌ش رو پرداخت کن و نسخه ی تایپ شده‌ش رو تحویل بگیر</h3>
				</Grid>
				<Grid item xs={6}>
					<h2>تایپیست</h2>
					<h3>پروژه تابپت رو ثبت کن</h3>
					<h3>از بین پیشنهاد ها، تایپیست مورد نظر رو انتخاب کن</h3>
					<h3>هزینه‌ش رو پرداخت کن و نسخه ی تایپ شده‌ش رو تحویل بگیر</h3>
				</Grid>
			</Grid>
		</div>
	);
};

export default Introduction;
